import React, { useState } from 'react'
import './styles/style.css'
import useInterval from './useInterval'

function App() {
  
  const [left, setLeft] = useState(95)
  const style = {
    left: `${left}%`
  }
  
  function moveObject(){
    setLeft((item)=> item-5)
  }

  useInterval(moveObject,20000)
  console.log(left)

  return (
    <div className="canvas">
        <div className="obstacle" style={style}></div>
    </div>
  )
}

export default App
